import { AboutUs, Footer, Header, Intro, SpecialMenu } from './container';
import { Navbar } from './components';
import './App.css';

const App = () => (
  <div>
    <Navbar />
    <Header />
    <AboutUs />
    <section id="Menu">

      <SpecialMenu />
    </section>
    <Footer />
  </div>
);

export default App;
